// Layout.js
import { Outlet } from "react-router-dom";
import Sidebar from "../../component/sideBar";
import "./index.scss";

function Layout() {
  return (
    <div className="userSidebar">
      <div className="sidebarSection"><Sidebar Admin={false} /></div>
      <div className="userLayout">
        <Outlet />
      </div>
    </div>
  );
}

export default Layout;
